import React, {Component} from 'react';
import Aslide from "./Aslide";
import Nutslide from "./Nutslide";

class Slider_top extends Component {
    render() {
        return (
            <div className="slidewrapper">
                <div className="slider" data-aos="zoom-out">
                <ul>
                  <Aslide anhnen="img/SEO2.jpeg" link1="img/nd.png" link2="img/nt.png" tieudeslide="SEO" ndslide="Thích viết gì thì viết"  />
                  <Aslide/>
                  <Aslide/>
                </ul>
                    <Nutslide/>
            </div>
            </div>

        );
    }
}

export default Slider_top;
